import React from "react";
import "./Footer.css";
import Wave from "../../img/wave.png";
import Insta from "@iconscout/react-unicons/icons/uil-instagram";
import Facebook from "@iconscout/react-unicons/icons/uil-facebook";
import Gitub from "@iconscout/react-unicons/icons/uil-github";
import Phone from "@iconscout/react-unicons/icons/uil-phone"
import Email from "@iconscout/react-unicons/icons/uil-fast-mail"
import Location from "@iconscout/react-unicons/icons/uil-location-point"
import Heart from "@iconscout/react-unicons/icons/uil-heart-medical"

const Footer = () => {
  return (
    <>
    <div className="footer">
      <img src={Wave} alt="" style={{ width: "100%" }} />
      <div className="f-content">
      <div class="box-thenk">
          <h3 className="thenk">Shoaib's Portfolio</h3>
          <p className="then">Thank you for visiting my personal portfolio <br /> website. Connect with me over socials. <br/> <br/> Keep Rising 🚀. Connect with me over live chat!</p>
      </div>
      <div className="right">
        <div class="box">
          <h3>contact info</h3>
          <p> <Phone color="white" size={"1rem"} />+91 304-6413094</p>
          <p> <Email color="white" size={"1.5rem"} />sho03046413094@gmail.com</p>
          <p> <Location color="white" size={"1rem"} />Pakistan, Punjab</p>
      </div>
        <div className="f-icons">
          <Insta color="white" size={"3rem"} />
          <Facebook color="white" size={"3rem"} />
          <Gitub color="white" size={"3rem"} />
        </div>
        </div>
      </div>
    </div>
     <hr />
     <h1 className="credit">Designed with <Heart color="white" size={"1rem"} /> by <a href="https://www.linkedin.com/in/m-ali-158284245/"> Shoaib Ali</a></h1>
     </>
  );
};

export default Footer;
